import React from 'react';

class Item extends React.Component{
    constructor(props){
        super(props);
        this.state={
            detail:"Bringing Daniel Costa's vision"
        }
    }
    render(){
        const div = <div className={'item'}><div className={'item_kind'}></div><div className={'item_picture'}></div>
            <div className={'item_detail'}><div className={'item_detail_detail'}></div><div className={'item_detail_date'}></div></div></div>;
        return(div);
    }
}

export default Item;
